/A/${SF_TARGET_NAME}\"\n\n\n# Move Simperium.framework to {Project Dir} / Out / Simperium.framework\nif [ ! -d \"${SF_OUTPUT_FOLDER}/\" ]; then\n    mkdir \"${SF_OUTPUT_FOLDER}/\"\nfi\n\nrm -rf \"${SF_OUTPUT_FOLDER}/${SF_WRAPPER_NAME}\"\nmv -f \"${BUILT_PRODUCTS_DIR}/${SF_WRAPPER_NAME}/\" \"${SF_OUTPUT_FOLDER}/${SF_WRAPPER_NAME}/\"\n";
